import "../css/friends.css";
export default function SideBarFriends() {
   return (
    <>
    <div className="side-bar-friends-status-options-main-container">
            <div
              onClick={(e) => {
                // changeCatagorySideBar(1, e);
                clickAudio();
              }}
              className="catagory-option catagory-option-acitve"
            >
              Friends
            </div>
            <div
              onClick={(e) => {
                // changeCatagorySideBar(2, e);
                clickAudio();
              }}
              className="catagory-option "
            >
              Requests
            </div>
            <div  className="catagory-option-slider"></div>
          </div>
    </>
   )
}
